import React, { useRef, useState } from 'react'
import {Swiper,SwiperSlide} from 'swiper/react'
import './Banner2.css'
import 'swiper/css'
import 'swiper/css/pagination'
import 'swiper/css/effect-coverflow';

// import 'swiper/css/navigation';
// import './styles.css'
import  { EffectCoverflow, Pagination, Autoplay, Navigation } from 'swiper/modules';


const Banner2: React.FC  = () => {
  const progressCircle = useRef<SVGSVGElement | null>(null);
  const progressContent = useRef<HTMLSpanElement | null>(null);
  const [workouts, setWorkouts] = React.useState<any[] | null>(null);
  const onAutoplayTimeLeft = (swiper: Swiper, timeLeft: number, percentage: number) => {
    if (progressCircle.current) {
      progressCircle.current.style.setProperty('--progress', (1 - percentage).toString());
    }
    if (progressContent.current) {
      progressContent.current.textContent = `${Math.ceil(timeLeft / 1000)}s`;
    }
  };

  
   const getworkouts=async ()=>{
    let data: any=[
      {
        type: 'Chest',
        imageUrl: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRm3t52ymWtIdIgrrSxcvtAk-i3rTBLYMVYTw&usqp=CAU',
        durationInMin: 30
      },
      {
        type: 'Abs',
        imageUrl: 'data:image/jpeg;base64,',
        durationInMin: 90
      },
      {
        type: 'Shoulder',
        imageUrl: 'data:image/jpeg;base64,',

        durationInMin: 40
      },
      {
        type: 'Back',
        imageUrl: 'data:image/jpeg;base64,',

        durationInMin: 70
      },
      {
        type: 'Biceps',
        imageUrl: 'data:image/jpeg;base64,',
        durationInMin: 50
      },
      {
        type: 'Triceps',
        imageUrl: 'data:image/jpeg;base64,',
        durationInMin: 60
      },

      {
        type: 'Legs',
        imageUrl: 'data:image/jpeg;base64,',
        durationInMin: 80
      },

      {
        type: 'Cardio',
        imageUrl: 'data:image/jpeg;base64,',
        durationInMin: 100
      },
      {
        type: 'Forearms',
        imageUrl: 'data:image/jpeg;base64,',
        durationInMin: 110
      }
    ]
    setWorkouts(data)
   }
   React.useEffect(()=>{
    getworkouts()
   },[])

  return (
    <div>
         <h1 className='main'>Drill</h1>
      <Swiper
        effect={'coverflow'}
        centeredSlides={true}
        autoplay={{
          delay: 2000,
          disableOnInteraction: false,
        }}
        slidesPerView={'auto'}
        coverflowEffect={{
          rotate: 50,
          stretch: 0,
          depth: 100,
          modifier: 1,
          slideShadows: true,
        }}
        pagination={true}
        navigation={true}
        modules={[EffectCoverflow, Pagination, Autoplay, Navigation]}
        onAutoplayTimeLeft={onAutoplayTimeLeft}
        className="mySwiper"
      >
        {workouts && workouts.map((item, index) => (
          <SwiperSlide key={index}>
            <div
              className='swiper-slide'
              style={{ backgroundImage: `url(${item.imageUrl})` }}
              onClick={() => {
                window.location.href = `/workout/${item.type}`;
              }}
            >
              <div className='swiper-slide-content'>
                <h2>{item.type}</h2>
                <p>{item.durationInMin} min</p>
              </div>
            </div>
          </SwiperSlide>
        ))}
        <div className="autoplay-progress" slot="container-end">
          <svg viewBox="0 0 48 48" ref={progressCircle}>
            <circle cx="24" cy="24" r="20"></circle>
          </svg>
          <span ref={progressContent}></span>
        </div>
      </Swiper>
   
    </div>
  )
}

export default Banner2